const style = {
	fontSize: '30px',
	fontFamily: 'serif',

	backgroundImage: `url("https://c4.wallpaperflare.com/wallpaper/498/712/47/food-burger-burgers-fries-hd-wallpaper-preview.jpg")`,
  textTransform: 'uppercase',

  textAlign: 'center',
};

const Contact = () => {
	return (
		<div style={style}>
			<h1>Contact</h1>
			<h2>Please reach us @www.burgernbite.com</h2>
			<h3>Contact us with: 000123456</h3>
		</div>
	);
};

export default Contact;
